// rfc
import "./topbar.css"


export default function topbar() {
    return (
        <div className="top">
           <div className="topleft"><i class="fab fa-facebook"></i></div>
           <div className="topcenter"><i class="fab fa-twitter"></i></div>
           <div className="topright">r</div>
        </div>
    )
}
